--
-- Table structure for table `person`
--

DROP TABLE IF EXISTS `person`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `person` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `document_type` varchar(45) DEFAULT NULL,
  `document_number` varchar(45) DEFAULT NULL,
  `name` varchar(45) NOT NULL,
  `last_name` varchar(45) DEFAULT NULL,
  `type` varchar(45) NOT NULL,
  `contact_name` varchar(50) DEFAULT NULL,
  `address` varchar(100) DEFAULT '',
  `city_id` bigint(20) DEFAULT NULL,
  `neighborhood` varchar(45) DEFAULT NULL,
  `mobile` varchar(20) DEFAULT '',
  `phone` varchar(20) DEFAULT '',
  `email` varchar(50) DEFAULT '',
  `web_site` varchar(250) DEFAULT '',
  `bank_account_id` bigint(20) DEFAULT NULL,
  `creation_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `modify_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `archived` bit(1) NOT NULL,
  PRIMARY KEY (`id`,`archived`),
  KEY `person_city` (`city_id`),
  KEY `person_bank_account_idx` (`bank_account_id`),
  CONSTRAINT `person_bank_account` FOREIGN KEY (`bank_account_id`) REFERENCES `bank_account` (`id`),
  CONSTRAINT `person_city` FOREIGN KEY (`city_id`) REFERENCES `city` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=84 DEFAULT CHARSET=utf8 COMMENT='Tabla para el almacenamiento de clientes, proveedores, terceros o cualquier tipo de persona';
/*!40101 SET character_set_client = @saved_cs_client */;

